import React, { useState } from 'react';

function App(){
    const[count, setCount] = useState(0);

   
   
    const change = () => {
        setCount();
    }

    return (
        <React.Fragment>
           <h1>Count-Up : {count}</h1>
            <button onClick={change}>Click</button>
        </React.Fragment>
    )
}

export default App;
